import React from 'react'

function ViewTodo({ todo, setTodo }) {
    return (
        <div>
            <div>
                {
                    todo.map((item, index) => {
                        <div key={index}>
                            <h1>{item.name}</h1>
                            <h1>{item.email}</h1>
                            <h1>{item.name}</h1>
                            <h1>{item.name}</h1>
                        </div>
                    })
                }
            </div>
        </div>
    )
}

export default ViewTodo
